(1, '2021-07-24', 'Galaxy Kannan', '2nd Year Anniversary', 'குமரி அறக்கட்டளையின் இராண்டாம் ஆண்டு நிறைவு விழாவும் மூன்றாம் ஆண்டு துவக்க விழாவும் 26/06/2021 காலை 10:00 மணியளவில் மிகவும் எளிமையான முறையில் குமரி அறக்கட்டளை அலுவலகத்தில் வைத்து மிகவும் சிறப்பாக குலசேகரம் காவல் துறை உதவி ஆய்வாளர் மற்றும் உதவும் கரங்கள் நிறுவனர் G v .சுரேஷ் அவர்கள் மற்றும் குமரி அறக்கட்டளை நிர்வாகிகள் உறுப்பினர்கள் கலந்து கொண்டு சிறப்பித்தனர் என்பதை மிகவும் மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன் மேலும் ஒத்துழைப்பை வழங்கி இரண்டாண்டுகளாக பயணித்து கொண்டிருக்கும் உடன் பிறவா சகோதர சகோதரிகளுக்கும் என்னுடைய மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன்', 'Active'),
(2, '2022-02-16', 'Admin', 'குமரி அறக்கட்டளையின் உறுப்பினராக பயணித்த பேச்சிப்பாறை செளந்தர் நம்மை விட்டுபிரிந்த அவர்களின் குடும்பத்திற்கு வீட்டிற்கு தேவையான  பலசரக்கு மற்றும் காய்கறிகள் ஒரு மாதத்திற்கு', 'குமரி அறக்கட்டளையின் உறுப்பினராக செயல்ப்பட்ட உடன்பிறவா சகோதரர் சொளந்தார் அவர்கள் நம்மை விட்டு பிரிந்த நிலையில் அவர்களின் குடும்பத்திற்கு தேவையான அரிசி மற்றும் காய்கறிகள் வழங்கி அவர்களின் குடும்பத்திற்கு ஆறுதல் கூறி அவர்களுக்கு வேண்டிய உதவி வழங்கவும் வாக்குறுதி அளித்துள்ளோம் மேலும் அனைத்து நல்லுள்ளங்களுக்கும் என்மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன் ஒத்துழைப்பு வழங்கிய ஜெபராஜ் அவர்களுக்கு மனமார்ந்த நன்றி', 'Active'),
(3, '2022-02-16', 'Admin', 'கருங்கல் கண்ணன்விளையை சார்ந்த பபிஷா மருத்துவ உதவித்தொகை 18/07/2021 ₹ 25000', 'குமரி மாவட்டத்தில் மேலவீட்டு விளை கண்ணன் விளை கருங்கல் பகுதியை சேர்ந்த செல்லத்துரை மகள் பபிஷா (17) 9715342751 பபிஷா அவர்களுக்கு மருத்துவ உதவித்தொகை ரூபாய் 25000 18/07/2021 அன்று மாலை 05:00 மணியளவில் வழங்கப்பட்டுள்ளது என்பதை மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன் மேலும் உதவித்தொகை வழங்கிய அனைத்து நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்த நல்லுள்ளங்களுக்கும் மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன்', 'Active'),
(4, '2022-02-19', 'Admin', '01/08/2019 அன்று குழித்துறை அரசு மருத்துவ மனையில்  ஏழை குழந்தைகளுக்கு 50  இலவச ஆடைகள் வழங்கப்பட்டது', 'குமரி மாவட்டத்தின் குழித்துறை அரசு மருத்துவமனையில் 01/08/2019 அன்று காலை 10:00 மணியளவில் குமரி அறக்கட்டளை சார்பாக ஏழை எளியவர்களுக்கு பிறந்த பச்சிளம் ஏழை குழந்தைகளுக்கு சுமார் 50 பேருக்கு இலவச ஆடைகள் வழங்கப்பட்டது என்பதை தெரிவித்து கொள்கிறேன் மேலும் மருத்துவர் சரண்யா வழங்க நிர்வாகிகள் குமரிராஜேந்திரன் ஜெயராஜ் சிபின் மனோஜ் சாமுவேல் ஆகாஷ் அவர்கள் உடன் இருந்தனர் மேலும் உதவிபுரிந்த நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்தவர்களுக்கும் பத்திரிக்கையாளர்களுக்கும் குமரி அறக்கட்டளை சார்பாகவும் என் சார்பாகவும் நன்றியும் நன்றி கலந்த பாராட்டுக்களையும் தெரிவித்து கொள்கிறேன்', 'Active'),
(5, '2022-02-22', 'Admin', 'குலசேகரம் மகேஷ்வரி அவர்களுக்கு உதலித்தொகை 31/07/2021 அன்று ₹ 15000  வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் செம்பருத்தி விளை பறவன் தலவிளை வீடு,வெண்டலிகோடு மகேஷ்வரி (கணவர் இல்லை) 9488139670. *நம் சேவையறிந்து உதவி கோரி விண்ணப்பித்திருந்திருந்த இவர்களுக்கு *உதவித்தொகை 31/07/2021 அன்று குமரி அறக்கட்டளை அலுவலகம் குலசேகரத்தில் வைத்து காலை 11:00 மணியளவில் உதவித் தொகைக்கான *காசோலை ₹ 15000 வழங்கப்பட்டது என மிக மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன் மேலும் *அனைத்து உறுப்பினர்களுக்கும் மற்றும் நிர்வாகிகளுக்கும் *உதவிபுரிந்த அனைத்து நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்தவர்களும் எங்களோடு *ஜாதி, மதம் இனம் ,மொழி என்று பாராமல் *குமரி மாவட்டத்தில் இருக்கும் ஒற்றுமைப்போல் குமரி அறக்கட்டளையிலும் ஒற்றுமையாய் இணைந்து செயல்பட்டுக்கொண்டிருக்கும்உடன்பிறவா சகோதர சகோதரிகளுக்கு என் மனமார்ந்த நன்றியை கணிக்கையாக்குகிறேன் மேலும் நாம் அனைவரும் ஒற்றுமையுடன் சிறப்பாக செயல்படவேண்டுகிறேன் மேலும் நாம் நம்மால் இயன்ற உதவியை செய்ய தாங்கள் அனைவரும் முன் வர மிகவும் தாழ்மையுடன் கேட்டுக்கொள்கிறேன்', 'Active'),
(6, '2022-02-12', 'Admin', 'Honouring Time', 'குமரி அறக்கட்டளையின் சேவையை பாராட்டி ரோட்டரி க்ளப் (மார்த்தாண்டம் )சார்பாக 22/08/2021 விருது வழங்கி கெளரவிக்கப்பட்டது ஒத்துழைப்பு வழங்கி கொண்டிருக்கும் அனைத்து உடன்பிறவா சகோதர சகோதரிகளுக்கும் மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன்', 'Active'),
(7, '2022-03-01', 'Admin', 'நாகர்கோயில் வடிவீஸ்வரம் தனலெட்சுமி 15/08/2021 அன்று உதவித்தொகை ₹ 15000 வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் தனலெட்சுமி (கணவர் இல்லை) நாகராஜன் 8760588479 மாரி தெரு ,வடிவீஸ்வரம் ,நாகர்கோவில் இவருடைய கணவர் கடந்த வருடம் சர்க்கரை நோயால் பாதிக்கப்பட்டு இறந்தார் சொந்த வீடு இல்லாமலும் எந்த வருமானமும் இல்லாமலும் தன்னுடைய பிள்ளைகள் சரவணன் (14) தினேஷ் (12) வீட்டு வேலை செய்து, வீட்டு செலவுகளையும் செய்து, வீட்டு வாடகையையும் கொடுத்து வர மிகவும் சிரமப்பட்டு வாழ்க்கை நடத்தி வந்த தனலெட்சுமி குடும்பத்திற்கு 15/08/2021 ஞாயிறு மாலை :4:00 மணியளவில் ₹ 15000 க்கான காசோலை மற்றும் நிர்வாக குழு உறுப்பினர் சஜி அவர்கள் அரிசியும் வழங்கப்பட்டது என்பதை மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன் மேலும் உதவிபுரிந்த நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்தவர்களுக்கும் நன்றியை தெரிவித்து கொள்கிறேன் மேலும் ஜாதி மதம் இனம் மொழிக்கு அப்பாற்பட்டு ஒற்றுமையுடன் செயல்பட கேட்டுக்கொள்கிறேன்', 'Active'),
(8, '2022-03-01', 'Admin', 'அருமனை குழிச்சல்  ராஜன் அவர்களுக்கு 15/09/2021 அன்று மருத்துவ உதவித்தொகை ₹ 15000 வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் அருமனை குழிச்சல் மூநம்பு பகுதியை சேர்ந்த ராஜன் 98944 32917 அவர்கள் மரத்திலிருந்து விழுந்து இடுப்பு எலும்பு உடைந்து கழுத்துக்கு கீழ் பகுதியான மொத்த உடலும் செயலிழந்து படுக்கையில் உள்ளார் அவருக்கு மருத்துவ உதவித்தொகையாக 15/09/2021 மாலை 03:00 மணியளவில் உதவித்தொகையாக ₹ 15000 க்கான காசோலை குமரி அறக்கட்டளை சார்பாக வழங்கப்பட்டது என்பதை மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன் மேலும் உதவி செய்த அனைத்து நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்த சகோதர சகோதரிகளுக்கும் மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன்', 'Active'),
(9, '2022-02-19', 'Admin', 'திருவட்டார் அருவிக்கரை பகுதியை சேர்ந்த  ரமேஷ் அவர்களுக்கு இரண்டாம் கட்ட அவசரமருத்துவ  உதவியாக 17/04/2021. அன்று ₹ 7000  வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் ரமேஷ் 9539578346 உண்ணாவிளை ,திருவட்டார் இரண்டு ஆண்டுகளாக புற்றுநோயால் பாதிக்க பட்ட கூலி தொழிலாளி க்கு 17/04/2021 அன்று மருத்துவ உதவி செய்துள்ளோம் தற்போது Scan செய்வதற்காக எந்த வித வருமானமோ வசதியோ இல்லாத காரணத்தினால் நாளை 30/08/2021 அன்று Scan செய்வதற்கு போதிய ரூபாய் இல்லாத காரணத்தினால் அவசர மாக ரூபாய் 7000 தேவைப்படுகிறது என்று அலைபேசியில் கேட்டுகொண்டனர் அவசர மருத்துவ உதவியாக ரூபாய் 7000 த்திற்கான காசோலை குமரி அறக்கட்டளையின் சார்பாக வழங்கப்பட்டது என்பதை மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன்', 'Active'),
(10, '2022-02-19', 'Admin', 'திருவட்டார் அருவிக்கரை பகுதியை சார்ந்த  ரமேஷ் அவர்களுக்கு மருத்துவ உதவித்தொகை ₹ 17/04/2021 அன்று ₹15000  வழங்கப்பட்டது', 'புற்று நோயால் பாதிக்கப்பட்டு வறுமையில் வாடிக்கொண்டிருந்த திருவட்டார் ரமேஷ் 9539578346 அவர்களுக்கு 17/04/21 இன்று மருத்துவ உதவித்தொகையாக ₹ 15000 வழங்கப்பட்டது மேலும் ஒரு மாதத்திற்கு தேவையான பலசரக்கு சாமான்களை அபின் முன்சிறை அவர்கள் தன்னுடைய முழு முயற்சியால் தானமாக வழங்கினார்கள் உதவி வழங்கிய அனைத்து நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்த நல்லுள்ளங்களுக்கும் குமரி அறக்கட்டளையின் சார்பாக நன்றியை தெரிவித்து கொள்கிறோம்', 'Active'),
(11, '2022-02-16', 'Admin', 'காரோடு கல்லிவிட்டன் குழி பகுதியை சார்ந்த. நெல்சன் ,ஒமனா படுக்கையாக உள்ள இருவருக்கும் சிறுபிள்ளைகள் நிஷா அவர்களின் தாய் தந்தைக்கு மருத்துவ உதவித்தொகை 30/11/2021 அன்று ₹ 25000 வழங்கப்பட்டது', '*குமரி மாவட்டத்தில்   கல்லிவிட்டன் குழி, காரோடு  பகுதியை சார்ந்த நெல்சன்  (மனைவி) ஓமனா 9486414794 இவர்கள் இருவரும்  கடந்த ஒருவருட காலமாக  பக்கவாத நோயால்  பாதிக்கப்பட்டு படுத்த படுக்கையாகவே உள்ளனர் இவர்களுக்கு பிள்ளைகள்  நிஷா (13) மற்றும் 10 வயது சிறுவனும் உள்ளனர் இந்த  குடும்பத்திற்கு  30/11/2021  உதவித்தொகை ₹ 25000 க்கான காசோலை வழங்கப்பட்டது என்பதை மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன் மேலும் அவர்களுக்கு எப்போது உதவி தேவைப்பட்டாலும் உதவி கரம் நீட்ட குமரி அறக்கட்டளை காத்துக்கொண்டிருக்கிறது என்ற வாக்குறுதியும் வழங்கப்பட்டது மேலும் உதவி புரிந்த அனைத்து நல்லுள்ளங்களுக்கும் அதற்காக அயராது உழைத்த சகோதர சகோதரிகளுக்கும் இவ்வுலகில் மனித நேயம் இன்றளவும் மாறவில்லை என்று நிருபித்த தமிழக மக்களுக்கும் என் மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன் மேலும் குமரி அறக்கட்டளையின் செய்தியை பார்த்து ஓடோடி சென்று உதவிக்கரம் நீட்டிய அறக்கட்டளைகள், மன்றங்கள் ,சமூக அக்கரை கொண்ட அமைப்புகள் அனைவருக்கும் குமரி அறக்கட்டளை சார்பாக நன்றியை உங்களுக்கு காணிக்கையாக  அளிக்கிறோம்', 'Active'),
(13, '2021-12-11', 'Admin', '26/11/2021 இலவச இரத்த தானம் 2000 யூனிட் வழங்கப்பட்டது', 'நம்முடைய குமரி  அறக்கட்டளை 26/11/2021 இரத்த தானம் தோராயமாக இல்லாமல் அலுவலக பதிவேட்டின்  படி 2000 யூனிட் இரத்தத்தை தானமாக செய்துள்ளது என்பதை மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன் மேலும் குமரி மாவட்ட இரத்த தான நன்கொடையாளர்கள் மற்றும் தன்னார்வலர்கள் அனைவருக்கும் எங்களது மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன்??????????????????????????', 'Active'),
(14, '2022-02-16', 'Admin', 'காஞ்ஞாம்புரம் செக்கிட்டிவிளையை சார்ந்த குழந்தை  ஆஷிகா அவர்களுக்கு மருத்துவ உதவி   30/10/2021 அன்று ₹ 20000 வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் செக்கிட்டிவிளை காஞ்ஞாம்புரத்தை சேர்ந்த ஆஷிகா  (குழந்தை) அப்பா இல்லை (மகேஷ் அப்பா)அம்மா ஷானிகா    9488286821 ஆஷிகா பிறந்த 54 நாட்களிலேயே தந்தை இறந்து விட்டார்.ஆஷிகா சிறுவயதிலேயே ஊனமுற்றவளாக பிறந்தார் நடக்கும் பருவத்தில் நடக்கவில்லையே என்று தாயார் மருத்துவரை அணுகியபோது இப்போது சிறுகுழந்தை அவளை நடக்க வைக்க முடியும் என்று நம்பிக்கை தெரிவித்ததின் பேரில் நம்மிடம் உதவி கோரி 09/10/2021 விண்ணப்பித்துள்ளார் உள்ளார் அதன் அடிப்படையில் வருகின்ற 31/10/2021  மாலை :4:00 மணியளவில் *மருத்துவ உதவித்தொகை ₹ 20000 காசோலையாக வழங்கப்பட்டது* என்பதை மகிழ்ச்சியுடன்    தெரிவித்து கொள்கிறேன் மேலும் உதவி செய்த அனைத்து சகோதர சகோதரிகளுக்கும் மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன் மேலும் ஜாதி மதம் இனம் மொழிக்கு அப்பாற்ப்பட்டு குமரி மாவட்ட ஏழை எளிய மக்களுக்கு உதவிடுவோம்', 'Active'),
(15, '2022-02-16', 'Admin', 'பெருஞ்சாணி மலைஇடிஞ்சான் பகுதியை சார்ந்த புற்று நோயால் பாதிக்கப்பட்ட சுஜிமோள் அவர்களுக்கு 15/12/2021 அன்று மருத்துவ உதவித்தொகை ₹ 15000 வழங்கப்பட்டது', 'குமரி மாவட்டத்தில்  மலைஇடிஞ்சான் விளை பெருஞ்சாணி பகுதியை சார்ந்த சசிந்தரா மகள்  சுஜிமோள் 9489 528975. இவருடைய கணவர்  இரண்டு வருடத்திற்கு முன்பு படுத்த படுக்கையிலேயே இறந்து விட்டார் இவர்களுக்கு இரண்டு  பிள்ளைகள் மூத்த பிள்ளை 5 ஆம் வகுப்பிலும் இரண்டாம் பிள்ளை  3 வகுப்பு படித்து வருகிறார்கள்  கணவரை இழந்த சுஜிமோள் தற்போது  புற்று நோயால் பாதிக்கப்பட்டு குலசேகரம்  மூகாம்பிகா மருத்துவமனையில் சிகிச்சை பெற்று வருகிறார் இவருடைய மருத்துவ உதவி 15/12/2021 அன்று மாலை 4:00 மணிக்கு ₹ 15000 க்கான காசோலை வழங்கப்பட்டது என்பதை மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன் மேலும் உதவி செய்த அனைத்து நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்தவர்களுக்கும் மனதார நன்றியை தெரிவித்து கொள்கிறோம்', 'Active'),
(16, '2022-02-16', 'Admin', 'ஆஷிகா கைசூண்டி 26/01/2022 ஏழை பெண்ணின் திருமண உதவி ₹ 15000', 'குமரி மாவட்டத்தில்  கைசூண்டி, பைங்குளம் பகுதியை சார்ந்த தங்கம் அவர்கள் மகள் ஆஷிகா( 25) 9443143503 .ஆஷிகா கைகுழந்தையாக இருக்கும் போது அப்பா இறந்து விட்டார். அம்மாவும் இருதய நோயால் பாதிக்கப்பட்டு மருத்துவ சிகிச்சையில் உள்ளார் .எந்த வருமானமும் இல்லை எந்த வேலையும் செய்யவும் இயலாது. கணவரையும் இழந்து எந்த வருமானமும் இல்லாத ஆஷிகாவை  திருமணம் செய்து வைக்க போதிய வருமானம் இல்லாமல் குமரி அறக்கட்டளையின் உதவியை நாடிய *ஆஷிகாவின் திருமண உதவித்தொகை ₹ 15000,  26/01/2022 புதன்கிழமை அன்று மாலை :04:00 மணியளவில் வழங்கப்பட்டுள்ளது என்பதை தெரிவித்து கொள்கிறேன்* மேலும்  உதவி செய்த அனைத்து நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்தவர்களுக்கும் மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன்  மேலும் ஜாதி,மதம் ,இனம் ,மொழி என்று பாராமல் அனைவருக்கும் உதவி செய்ய ஒத்துழைப்பு வழங்க வேண்டுகிறேன்', 'Active'),
(17, '2022-04-21', 'Kumari Rajendran', 'கருங்கல் மங்கலகுன்று அருண்சிங் அவர்களுக்கு மருத்துவ உதவித்தொகை  15/01/2022 அன்று ₹ 15000 வழங்கப்பட்டது', 'குமரி மாவட்டத்தில்  பரக்குடி விளை,மங்கலகுன்று ,கருங்கல் பகுதியை சார்ந்த அபிஷா இவர் கணவர் அருண்சிங் (34)  8838428651 கூலி தொழியான இவர் கடந்த வருடம் வேலை பார்த்து கொண்டிருந்தபோது நிலை தடுமாறி கீழே விழுந்து முதுகெலும்பு உடைந்து படுத்த படுக்கையில் உள்ளார்    இவருக்கு மருத்துவ சிகிச்சை செய்ய மருத்துவ உதவித்தொகை 15/01/22 அன்று மாலை :4;00 மணியளவில் மருத்துவ உதவித்தொகை ₹ 15000 வழங்கப்பட்டது மேலும் உதவி செய்த நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்தவர்களுக்கும் மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன்   \r\n*Phone Pay*:8448425409', 'Active'),
(18, '2022-02-14', 'Admin', 'தூத்தூர் பகுதியை சார்ந்த ஜென்சின் வின்சென்ட் அவர்களுக்கு மருத்துவ உதவி 14/02/2022', 'குமரி மாவட்டத்தில் சின்னத்துறை தூத்தூர் பகுதியைச் சார்ந்த அல்போன்சம்மா வின்சென்ட் அவர்கள் மகன் ஜென்சின் வின்சென்ட் (34) 887013 6275 ஜென்சின் வின்சென்ட் அவர்களுக்கு சிறுநீரக கோளாறு காரணமாக மருத்துவ மனையில் சிகிச்சை பெற்று வருகிறார்  மருத்துவ உதவித்தொகை   14/02/2022 இன்று மாலை :3:00 மணியளவில் மருத்துவ உதவித்தொகை ₹ 15000. காசோலையாக வழங்கப்பட்டது என்பதை தெரிவித்து கொள்கிறேன் மேலும் உதவி செய்த அனைத்து சகோதர சகோதரிகளுக்கும் மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன் .', 'Active'),
(19, '2022-02-15', 'Admin', '12/01/22 அன்று கெத்சியாள் அவர்களுக்கு திருமண உதவி', 'குமரி மாவட்டத்தில்  மாத்தூர் பகுதியை சார்ந்த லலிதா பாய் அவர்கள் மகள் கெத்சியாள்( 22) 8275428434 லலிதா பாய் அவர்கள் கணவரால் கைவிடப்பட்ட இவர் பிள்ளைகளை காக்கும் நோக்கத்தில்  தூய்மை காவலர் வேலை பார்த்து வருகிறார்  இவருடைய மகள் கெத்சியாள் அவர்களுக்கு 12/01/2022. அன்று  திருவட்டார் கல்வாரி மண்டபத்தில் வைத்து திருமண உதவித்தொகை ₹ 20000 வழங்கபட்டது  மேலும் உதவி செய்த அனைத்து நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்த நல்லுள்ளங்களுக்கும் மனமார்ந்த நன்றியயை தெரிவித்து கொள்கிறோம்', 'Active'),
(20, '2022-03-01', 'Admin', '16/11/2021 ஆசாரிப்பள்ளம் ஜோசப் ஸ்டீபன் அவர்களுக்கு மருத்துவ உதவி ₹15000 வழங்கப்பட்டது', 'குமரி மாவட்டத்தில்   ஆசாரிப்பள்ளம் அந்தோனியார் தெரு, மேல பெருவிளை பகுதியை சேர்ந்த ஜோசப் ஸ்டீபன்(32) 9894860727 என்பவர் இரண்டாவது மாடியில் வேலை செய்து கொண்டிருந்த போது தவறி விழுந்து முதுகெலும்பு உடைந்து கடந்த மூன்றரை ஆண்டுகளாக படுத்த படுக்கையாகவே உள்ளார் அவருக்கு 16/11/2021 இன்று மாலை:04:00 மணியளவில்   மருத்துவ உதவித்தொகை ₹ 15000 க்கான காசோலை வழங்கப்பட்டது  மேலும் உதவி செய்த அனைத்து நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்த. அனைவருக்கும்  நன்றியை தெரிவித்து கொள்கிறேன்', 'Active'),
(21, '2022-02-16', 'Admin', 'சஜின் அவர்களுக்கு மருத்துவ உதவி 28/09/2021 அன்று ₹ 20000 வழங்கப்பட்டது', 'குமரி மாவட்டத்தில்  கொட்டமரத்தாணிவிளை பரம்பு கீழ்குளம் பகுதியை சேர்ந்த தங்கப்பன் மகன் சஜின் +91 73732 51831 அவர்கள்  15/09/2021 அன்று இருசக்கர வாகனத்தில் காலை இழந்து கிம்ஸ் மருத்துவ மனையில் சிகிச்சை பெற்று வந்த ஏழை குடும்பத்தை சார்ந்த சஜினுக்கு குமரி அறக்கட்டளை சார்பாக 28/09/2021 செவ்வாய்கிழமை ₹  20000 க்கான காசோலை குமரி அறக்கட்டளை அலுவலகத்தில் வைத்து வழங்கப்பட்டது என்பதை மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன் மேலும் உதவி செய்த அனைத்து சகோதர சகோதரிகளுக்கும் மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன் ??????????', 'Active'),
(22, '2022-02-19', 'Admin', 'மெதுகும்மல்  சமுயேல் அவர்களின் குடும்பத்திற்கு 15/01/2021 அன்று ₹15000 மளிகை பொருட்கள் வழங்கபட்டது', 'குமரி மாவட்டத்தில் சாமுயேல் தச்சக்கோடு மெதுகும்மல்   9360368613  மாற்று திறனாளி மற்றும் மனைவியும் மாற்று திறனாளி அவர்கள் CMC மருத்துவ மனையில்  சிகிச்சை பெற்று வந்தார் சிகிச்சை பெற்று கொண்டிருந்த போது மரணம் ஏற்பட்டதால் மருத்துவ உதவித்தொகை வழங்க இயலாத காரணத்தினால் தற்காலிகமாக நிறுத்தி வைக்கப்பட்டுருந்தன.  இன்று  05/09/2021 ஞாயிற்று கிழமை  மாலை 03:00 மணியளவில்  மருத்துவ உதவியாக  வழங்க இருந்ததை அவருடைய குடும்பத்திற்கு உதவித்தொகையாக ₹ 15000 த்திற்கான காசோலை மற்றும் ஒரு மாதத்திற்கான மளிகை பொருட்களும் வழங்கப்பட்டது என்பதை மகிழ்ச்சியுடன்  தெரிவித்து கொள்கிறேன் மேலும் உதவிபுரிந்த அனைத்து நல்லுள்ளங்களுக்கும் உதவி புரியநினைத்து இயலாத மனகவலையோடு உள்ள அனைத்து நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்தவர்களுக்கும் என் மனதார நன்றியை தெரிவித்து கொள்கிறேன்', 'Active'),
(23, '2022-03-01', 'Admin', 'ஜெலானி அவர்களுக்கு படிப்புதவி 24/06/2021 அன்று ₹20000 வழங்கப்பட்டது', '24/06/2021 அன்று  மாலை 3 மணியளவில் குமரி அறக்கட்டளையின் உதவியை நாடிய குறும்பனை குளச்சல் பகுதியை சார்ந்த லாயோலா மகள் ஜெலானி அவர்களுக்கு படிப்புதவி ₹ 20000 வழங்கப்பட்டது  என்பதை மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன் மேலும் உதவி செய்த அனைத்து நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்தவர்களுக்கும்  குமரி அறக்கட்டளையின் சார்பாக மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன்', 'Active'),
(24, '2022-02-19', 'Admin', '04/06/2021 கொரோனா நிவாரணம்', '04/06/2021 குமரி அறக்கட்டளை சார்பாக திக்கணங்கோடு அருமனை குருந்தன்கோடு  பகுதிகளில் கொரோனா நிவாரண பொருட்கள் இன்று  வழங்கப்பட்டது என்பதை மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன் மேலும் உதவிய அனைத்து நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்த அனைவருக்கும் மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன் ????????????????', 'Active'),
(25, '2022-02-28', 'Admin', '28/02/2022 சதா குடும்பத்திற்கு உதவித்தொகை ₹15000', 'குமரி மாவட்டத்தில் சுவாமி தோப்பு, விஜயநகரி பகுதியை சார்ந்த சதா(18) 7373991981 அவர்களின் அப்பா பாண்டியன் இருதய நோயால் பாதிக்கப்பட்டும் (63)அம்மா லட்சுமி (46) \r\nவாத நோயால் பாதிக்கபட்டும்  இருவரும் குலசேகரம் மூகாம்பிகை மருத்துவமனையில் சிகிச்சை பெற்று வருகின்ற இவர்களுக்கு   *28/02/2022 திங்கள் குமரி அறக்கட்டளை அலுவலகம் குலசேகரத்தில் வைத்து மருத்துவ உதவித்தொகை ₹ 15000 காசோலையாக வழங்கபட்டது  என்பதை தெரிவித்து கொள்கிறேன்* மேலும்  உதவி செய்த அனைத்து நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்த சகோதரர்களுக்கும் மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன் ஜாதி மதம் இனம் மொழி என்ற பேதமில்லாமல் அனைவரும் சமம் நோக்கோடு உதவிட அனைவரும் முன்வாருங்கள்', 'Active'),
(26, '2022-03-15', 'Admin', '15/03/2022 அன்று சிநேகாவிற்கு ₹ 15000 மருத்துவ உதவி', '*இயன்றதை செய்வோம்☪️?️✝️ இயலாதவர்கே*\r\n\r\n*குமரி அறக்கட்டளை*\r\n*பதிவு எண்:36/2019*\r\n *குலசேகரம்*\r\n*அரசு அங்கீகாரம் பெற்றது*\r\n\r\nகுமரி மாவட்டத்தில் குலசேகரம் பகுதியைச் சார்ந்த சரண்யா அவர்களது கணவர் அனீஷ் (40) 9746798741 இவருக்கு மூன்று வருட காலமாக முது எலும்பு தேய்வு காரணமாக வேலை எதுவும் செய்ய முடியாது. மிகவும் வறுமையில் இருக்கும் இவர்களுக்கு இரண்டு பெண் பிள்ளைகள் சினேகா(14) 9 ஆம் வகுப்பு படிக்கிறாள்.அனாமிகா(8)3. ஆம் வகுப்பு படிக்கிறாள்.   *சினேகாவிற்கு மருத்துவ உதவி 15/03/2022 அன்று மாலை :03:00 மணியளவில் குமரி அறக்கட்டளை சார்பாக ₹ 15000 க்கான காசோலை  குலசேகரம் அலுவலகத்தில் வைத்து வழங்கப்பட்டது என்பதை மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன்* மேலும் உதவி செய்த அனைத்து நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்த சகோதர சகோதரிகளுக்கும் மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன்', 'Active'),
(27, '2022-03-30', 'Admin', 'சுரேஷ் பளுகல் அவர்களுக்கு30/03/2022 மருத்துவ உதவி ₹20000', 'குமரி மாவட்டத்தில் நேரி புறம் பளுகல் பகுதியைச் சார்ந்த அபிஷா அவர்களது கணவர் சுரேஷ்(29)8344842796 அன்றாடம் கூலி வேலை செய்து குடும்பத்தை நடத்தி வந்தவர். அவருக்கு தலைவலி இருந்து வந்தது அதன் பிறகு ஊடுகதிர்(scan) செய்து பார்த்தபிறகு  தலையில் புற்றுநோய் கட்டி  இருப்பது தெரியவந்தது. அவருடைய மருத்துவ உதவித்தொகை  30/03/2022 அன்று குமரி அறக்கட்டளை அலுவலகம் குலசேகரத்தில் வைத்து ₹ 20000 க்கான காசோலை வழங்கப்பட்டது*  மேலும் உதவி புரிந்த அனைத்து  நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்தவர்களுக்கும் மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன்', 'Active'),
(28, '2022-04-02', 'Lathis', '16/03/2022 அன்று வரை 2500 யூனிட் இலவச இரத்த. தானம்', '16/03/2022 \r\nஅன்று குமரி அறக்கட்டளை 2500 யூனிட் இலவச இரத்த தானம் அலுவலக  பதிவேட்டின்படி செய்துள்ளது என்பதை மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன் மேலும் இரத்த தானம் செய்து உயிர்களை காக்கும் குமரி மாவட்ட இரத்த தான நன்கொடையாளர்களுக்கும்  அதற்கு முயற்சி செய்தவர்களுக்கும் குமரி அறக்கட்டளை சார்பாகவும் என் சார்பாகவும் மனமார்ந்த நன்றியையும் பாராட்டுக்களையும் தெரிவித்து கொள்கிறேன் மேலும் ஜாதி,மதம், இனம், மொழி என்று பாராமல் அனைவரும் சமம் என்று உணர்த்துவது இரத்த தானம் மட்டுமே அனைவரும் இரத்த தானம் செய்யுங்கள் உயிர்களை காப்பாற்றுங்கள் ???????????????????????', 'Active'),
(29, '2022-04-03', 'Lathis', 'சுமதி அருமனை அவர்களு 24/02/2022 வீட்டிற்கு தேவையான உணவு பொருட்கள்', 'சுமதி அருமனை  8056457917 24/02/2022 வீட்டிற்கு தேவையான உணவு பொருட்கள் வழங்கப்பட்டது', 'Active'),
(30, '2022-04-03', 'Lathis', 'ஜோதி குலசேகரம் 24/02/2022 வீட்டிற்கு தேவையான உணவு பொருட்கள் வழங்கப்பட்டது', 'ஜோதி குலசேகரம் ,9488182423,24/02/2022 வீட்டிற்கு தேவையான உணவு பொருட்கள் வழங்கப்பட்டது', 'Active'),
(31, '2022-04-03', 'Lathis', 'ஜெய்டன் தெற்றை 24/02/2022 வீட்டிற்கு தேவையான உணவு பொருட்கள்', 'ஜெய்டன் தெற்றை  8300943382 தாய் நோய்வாய்ப்பட்டு படுத்த படுக்கையில் உள்ளார் அவர்களுக்கு 24/02/2022 வீட்டிற்கு தேவையான உணவு பொருட்கள்  வழங்கப்பட்டது', 'Active'),
(33, '2022-04-15', 'Kumari Rajendran', '15/04/2022 அன்று சக்திநாதன் அவர்களுக்கு ₹20000 உதவித்தொகை', 'குமரி மாவட்டத்தில் வீரவநல்லூர் தோவாளை தாலுகாவை (2-8- நடுத்தெருவைச் சார்ந்த பா.சக்திநாதன்(42) (9488454400) அவர்களின் அப்பா இறந்து 3 வருடமாகிறது. அவருக்கு உடன்பிறப்பு யாருமில்லை *பிறவியிலே இருகைகளும் இருகால்களும் ஊனமுற்று பிறந்த இவருடைய வீட்டின் மேற்கூரை இடிந்து விழும் நிலையில் உள்ளது  மேற்கூரையை பழுது பார்க்க உதவித்தொகை  ₹20000, 15/04/2022 அன்று  வழங்கப்பட்டது என்பதை தெரிவித்து கொள்கிறேன்', 'Active'),
(34, '2022-07-27', 'Kumari Rajendran', 'பிளாறி குலசேகரம் அவர்களுக்கு 15/04/2022 உணவு பொருட்கள் வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் தும்பகோடு,குலசேகரம் பகுதியை சார்ந்த பிளாறி 8903541923 அவர்கள் உணவு பொருட்கள் இல்லாமல் இருப்பதையறிந்து குமரி அறக்கட்டளை சார்பாக வீட்டிற்கு தேவையான உணவு பொருட்கள் சுமார் இரண்டு  மாதத்திற்கு 15/04/2022 அன்று வழங்கப்பட்டது', 'Active'),
(35, '2022-04-26', 'Kumari Rajendran', 'சந்திரா அவர்களுக்கு தேவையான உணவுபொருட்கள் 21/04/2022 அன்று வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் குலசேகரம் அரசு மருத்துவ மனை சாலையில் சந்திரா கூலிவேலை 8489027495 கணவர் இல்லை நோய் வாய்ப்பட்டு உணவு பொருட்கள் இல்லாமல் தவித்து வந்தனர் அவர்களுக்கு  21/04/2022 அன்று ஒரு மாதத்திற்கு தேவையான உணவுபொருட்கள் வழங்கப்பட்டது', 'Active'),
(36, '2022-04-27', 'Kumari Rajendran', '26/03/2022 அன்று அருமனை சுசிலா அவர்களுக்கு உணவு பொருட்கள் வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் அருமனை பகுதியை சேர்ந்த சுசிலா அவர்கள் புற்று நோயால் பாதிக்கப்பட்டவர் என்று அறிந்ததும் தன் பிள்ளைகள் மற்றும் உறவினர்கள் வீட்டை விட்டு துரத்தி விட்டதால் உணவின்றி தவித்து வந்த இவருக்கு ஒரு மாதத்திற்கு தேவையான உணவு பொருட்கள் வழங்கப்பட்டது', 'Active'),
(37, '2022-04-27', 'Kumari Rajendran', '21/04/2022 அன்று தங்கம் விரிகோடு அவர்களுக்கு உணவு பொருட்கள் வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் விரிகோடு பகுதியை சேர்ந்த தங்கம் 9629098079 கணவரை இழந்தவுடன் தன் தாயை தனியாக விட்டு சென்ற மகன் உணவு பொருட்கள் இன்றி தவித்து வந்த இவருக்கு ஒரு மாதத்திற்கு தேவையான உணவு பொருட்கள் 21/04/2022 பொருட்கள் வழங்கப்பட்டது', 'Active'),
(38, '2022-05-07', 'Kumari Rajendran', '30/04/2022 அன்று நித்யாமேரி அவர்களுக்கு திருமண உதவி ₹20000 மற்றும் பட்டு புடவை வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் கடமாங்குழி கோலங்கோட்ட விளை ஆலஞ்சி பகுதியைச் சார்ந்த (9566742915) ஸ்டெல்லா அவர்களின் தங்கை (விஜிலா மேரி) அவர்கள் கணவரால் கைவிடப்பட்டவர். அவர்கள் நோயினால் பாதிக்கப் பட்டு  இறந்துவிட்டார். அவர்களுக்கு மூன்று பிள்ளைகள். இரண்டு பெண் பிள்ளையும் ஒரு ஆண் பிள்ளையும் உள்ளனர். இந்த மூன்று பிள்ளைகளும்     தாய் தந்தையை இழந்து அனாதை மடத்தில் நின்று வாழ்ந்து  வந்தார்கள் இந்த பிள்ளைகளில்  மூத்த பிள்ளை *நித்தியா மேரி அவர்களுக்கு திருமண உதவித்தொகை ₹20000  மற்றும் பட்டுபுடவையும்  30/04/2022  வழங்கப்பட்டது என்பதை மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன் மேலும் பட்டுபுடவை அன்பளிப்பாக வழங்கிய சகோதரர் ஜெயசிங் அவர்களுக்கும் உதவி புரிந்த அனைத்து நல்லுள்ளங்களுக்கும் கோடி நன்றிகள்*??????????????????', 'Active'),
(41, '2022-05-15', 'Kumari Rajendran', 'ஹர்ஷினி அவர்களுக்கு 15/05/2022 மருத்துவஉதவி ₹20000 வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் வெட்டுர்ணி மடம் நாகர்கோவில் பகுதியை சார்ந்த மணிகண்டன் வயது(29)9600907768 கூலி தொழிலாளி அவர்களுக்கு இரண்டு பிள்ளைகள். முதல் பிள்ளை ஆண் வயது(4) இரண்டாவது பிள்ளை பெண் வயது(2) ஹர்ஷினி. அவர்களுக்கு அறுவை சிகிச்சை செய்ய மருத்துவ உதவி 15/05/2022 அன்று ₹20000 குமரி அறக்கட்டளை அலுவலகம் குலசேகரத்தில் வைத்து வழங்கப்பட்டது உதவி  புரிந்த அனைத்து நல்லுள்ளங்களுக்கும் என் மனமார்ந்த நன்றியை காணிக்கையாக்குகிறேன்', 'Active'),
(42, '2022-05-31', 'Kumari Rajendran', '31/05/2022 ஷோபா அவர்களுக்கு மருத்துவ உதவித்தொகை ₹15000 வழங்ப்பட்டது', 'குமரி மாவட்டத்தில் பத்மநாபபுரம் ஆர்.சி. தெரு தக்கலை பகுதியைச் சார்ந்த சகாய ஷோபா அவர்கள் கணவர் சிலோன் வயது(50)9943628890 அவர்களுக்கு இரண்டு பெண் பிள்ளைகள்.  கூலி வேலை செய்து குடும்பத்தை நடத்தி வந்தார். அவருக்கு தோல் நோய் மற்றும் சக்கரை நோயால் பாதிக்கப்பட்டு எந்த வேலையும் செய்ய முடியாமல் அவதிப்பட்டு வருகிறார்.  *ஷோபா அவர்களுக்கு மருத்துவ உதவி 31/05/2022 இன்று ₹15000 க்கான காசோலை குமரி அறக்கட்டளை சார்பாக வழங்கப்பட்டது என்பதை மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன்*  இந்த ஏழை குடும்பத்திற்காக இரங்கி நன்கொடையளித்த அனைத்து நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்தவர்களுக்கும் மனதார நன்றியை தெரிவித்து கொள்கிறேன்', 'Active'),
(44, '2022-06-30', 'Kumari Rajendran', '26/06/2022 மூன்றாம் ஆண்டு நிறைவு விழா 150 ஏழை எளிய மக்களுக்கு நலத்திட்ட உதவிகள் மருத்துவ உதவி 20000', 'குமரி அறக்கட்டளை 3 வருடங்களாக குமரி மாவட்ட மக்களுக்கு மாவட்ட அளவில் இலவச இரத்த தானம் மற்றும் மருத்துவ உதவி படிப்புதவி என பல்வேறு உதவிகளை செய்து வருகிறது மேலும் 26/06/2022 அன்று குமரி அறக்கட்டளையின் மூன்றாம் ஆண்டு நிறைவு விழா மற்றும் நான்காம் ஆண்டு துவக்க விழா அருமனை குஞ்சாலுவிளை பகுதியில் வைத்து வாகன பிரச்சாரம் மற்றும் இருசக்கர வாகனபேரணி நடைபெற்றது அதனை தொடர்ந்து மாவட்ட அளவில் இரத்த தான விழிப்புணர்வு போதை ஒழிப்பு விழிப்புணர்வு மற்றும் உறுப்பு தான விழிப்புணர்வு நடைபெற்றது விழாவில்  சிறப்பு விருந்தினராக தக்கலை மாவட்ட காவல்துறை கண்காணிப்பாளர் திரு. கணேசன் மற்றும் டாக்டர். பிரைட்சிங் பிரான்சீஸ்  அரசு மருத்துவர் குலசேகரம் அவர்கள் G.V. சுரேஷ் தனிமனித சேவை அறக்கட்டளை நிறுவனர் குலசேகரம் திரு.கண்ணன் குமரி அறக்கட்டளை சட்ட  ஆலோசகர் மற்றும் நிர்வாகிகள் உறுப்பினர்கள்  விழாவில் கலந்து கொண்டனர்  சந்தோஷ் (சஜு) குலசேகரம்  9791179305 அவர்களுக்கு மருத்துவ உதவி ₹20000 மற்றும் 20 ஏழை மாணவ மாணவிகளுக்கு பாடபுத்தகம் ஸ்கூல் பேக்  மற்றும் பள்ளி சீருடை வழங்கப்பட்டது மேலும் 130 ஆதரவற்றோர்களுக்கு இலவச வேஷ்டி சேலை அரிசி வழங்கப்பட்டது ஜாதிமதம் என்று பாராமல் ஒன்றே குலம் ஒருவனே தேவன் என்ற கொள்கையின் அடிப்படையில் இந்த சேவையை செய்து வருகிறோம் ஒத்துழைப்பு கொடுத்து கொண்டிருக்கும் அனைத்து நல்லுள்ளங்களுக்கும்  மனதார நன்றியை தெரிவித்து கொள்கிறேன்', 'Active'),
(45, '2022-07-15', 'Kumari Rajendran', '15/07/2022 அன்று இலவச இரத்த தானம் 3000 யூனிட் பூர்த்தி செய்யப்பட்டது', 'குமரி அறக்கட்டளை 15/07/2022 இன்று உயிரோடு இருந்து உயிர்காக்கும் தன்னலமற்ற உன்னதமான சேவையான இலவச இரத்த தானம் அலுவலக பதிவேட்டின் படி 3000 யூனிட் இரத்தத்தை பூர்த்தி செய்து சாதனை படைத்துள்ளது குமரி மாவட்ட தன்னார்வலர்கள் இரத்த தான நன்கொடையாளர்கள் அனைவருக்கும் குமரி அறக்கட்டளை சார்பாக நன்றியையும் நன்றி கலந்த வணக்கத்தையும் தெரிவித்து கொள்கிறேன்???????????????????????????????????????????????????', 'Active'),
(46, '2022-07-15', 'Kumari Rajendran', '15/07/2022 அன்று திக்குறிச்சிஏழை மாணவி படிப்புதவி ₹25000 வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் பாறைக்குளம் திக்குறிச்சி பகுதியைச் சார்ந்த ராணி (9942649791) அவர்கள் கணவர் இறந்து 8 வருடமாகிறது. அவர்களுக்கு கால் சுகமில்லாமல் எந்த வேலைக்கும் போக முடியாது. அவர்களுக்கு 2 பெண் பிள்ளைகள்.மூத்தமகள் நித்தியா BSC Nursing 4-வது வருடம் ராமகிருஷ்ணா கல்லூரி குலசேகரத்தில்  படித்து வருகிறாள்  அவர்களுக்கு படிப்புதவி  *15/07/2022 இன்று மாலை :04:00 மணியளவில் குமரி அறக்கட்டளை அலுவலகம் குலசேகரத்தில் வைத்து ₹ 25000 -க்கான வரைவோலை  வழங்கப்பட்டுள்ளது* உதவி புரிந்த அனைத்து நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்த அனைவருக்கும் மனதார நன்றியை  தெரிவித்து கொள்கிறேன் மேலும் *ஜாதி மத இன வேறுபாடின்றி அனைவரும் ஒற்றுமையுடன் செயல்பட்டு அனைத்து மக்களுக்கும் உதவி செய்வோம்*?????????????????????????????', 'Active'),
(47, '2022-07-21', 'Kumari Rajendran', '03/0/2020 அன்று வெங்கடேஷ் ஏர்வாடி அவர்களுக்கு வீல் செயர் வழங்கப்பட்டது', '01/03/2020 அன்று இடுப்புக்கு கீழே செயலிழந்து   கோட்டார் அரசு ஆயூர்வேதிக் மருத்துவமனையில் சிகிச்சை பெற்று வந்த வெங்கடேஷ் ஏர்வாடி அவர்களுக்கு  குமரி அறக்கட்டளை சார்பாக வீல்  செயர் வழங்கப்பட்டது', 'Active'),
(48, '2022-07-21', 'Kumari Rajendran', 'ஸ்ரீதரன் கணதிபுரம் அவர்களுக்கு அவசர மருத்துவ உதவி 11/04/2022 அன்று ₹ 6000 வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் அகஸ்தீஸ்வரம் தாலுகா கணபதிபுரத்தை சார்ந்த ஸ்ரீதரன்  9442554121 அவர்கள் கணையத்தில் வீக்கம் ஏற்பட்டு மிகவும் மோசமான நிலையில் இருந்த வண்ணம் குமரி அறக்கட்டளையின் நிர்வாகிகள் நேரில் சென்று பார்த்த போது வாரம் ஒரு ஊசி மருந்து போட வேண்டுமென மருத்துவமனையில் கூறியுள்ளனர் ஒரு மாதத்திற்கு ஊசிபோட ₹ 6000 வரை ஆகுமென தெரிவித்ததின் பேரில் *அவசர மருத்துவ உதவியாக 11/04/2022 குமரி அறக்கட்டளை சார்பாக ₹ 6000 உடனே வழங்கப்பட்டது* என்பதை தெரிவித்து கொள்கிறேன்', 'Active'),
(49, '2022-07-21', 'Kumari Rajendran', '15/10/2021 அன்று கோழிபோர் விளை சசிகுமார் ரம்யா அவர்களுக்கு மருத்துவ உதவி ₹ 20000 வழங்கப்பட்டது', '15/10/2021 அன்று கோழிப்போர் விளையை சேர்ந்த சசிகுமார் ரம்யா அரசமூடு சந்திப்பு குலசேகரத்தில் வைத்து அவர்களுக்கு மருத்துவ உதவி ₹ 20000 வழங்கப்பட்டது', 'Active'),
(50, '2022-07-22', 'Kumari Rajendran', '23/07/2019 அன்று ஹரிசுதன்(M B B S) அவர்களுக்கு படிப்புதவி ₹ 20000 வழங்கப்பட்டது', '23/07/2019 அன்று ஹரிசுதன்  73394 55602 அதங்கோடு  அவர்களுக்கு படிப்புதவி ₹ 20000 வழங்கப்பட்டது மட்டுமில்லாமல் மேற்படிப்பிற்க்கான வங்கி கடன் வழங்க ஏற்பாடு செய்யப்பட்டு M B B S திருநெல்வேலி மருத்துவ கல்லூரியில் படித்து வருகிறார்', 'Active'),
(52, '2022-07-27', 'Kumari Rajendran', '15/10/21 வெள்ளிகிழமை அன்று இரத்த தான மற்றும் உறுப்பு தான விழிப்புணர்வு அரசமூடு குலசேகரம்', '15/10/21 வெள்ளிகிழமை அன்று இரத்த தான மற்றும் உறுப்பு தான விழிப்புணர்வு அரசமூடு குலசேகரத்தில் வைத்து நடைபெற்றது', 'Active'),
(53, '2022-07-27', 'Kumari Rajendran', '29/06/2021 அன்று கணினி மயமாக்கப்பட்ட. நாள்', '29/06/2021 அன்று குமரி அறக்கட்டளை அலுவலகம் கணினி மயமாக்கப்பட்ட அழகிய தோற்றம்', 'Active'),
(54, '2022-07-27', 'Kumari Rajendran', '26/06/2021 அன்று 2 ஆம் ஆண்டு நிறைவு விழா எளிமையான  முறையில் அலுவலகத்தில் வைத்து நடைபெற்றது', 'குமரி அறக்கட்டளையின் இராண்டாம் ஆண்டு நிறைவு விழாவும் மூன்றாம் ஆண்டு துவக்க விழாவும் 26/06/2021 காலை 10:00 மணியளவில் மிகவும் எளிமையான முறையில் குமரி அறக்கட்டளை அலுவலகத்தில் வைத்து  மிகவும் சிறப்பாக குலசேகரம் காவல் துறை உதவி ஆய்வாளர்  மற்றும் உதவும் கரங்கள் நிறுவனர் G v .சுரேஷ் அவர்கள் மற்றும் குமரி அறக்கட்டளை நிர்வாகிகள் உறுப்பினர்கள் கலந்து கொண்டு சிறப்பித்தனர் என்பதை மிகவும் மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன் மேலும் ஒத்துழைப்பை வழங்கி இரண்டாண்டுகளாக பயணித்து கொண்டிருக்கும் உடன் பிறவா சகோதர சகோதரிகளுக்கும் என்னுடைய மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன்', 'Active'),
(55, '2022-07-27', 'Kumari Rajendran', '04/06/2021 அன்று கொரோனா நிவாரண பொருட்கள் வழங்கப்பட்டது', '04/06/2021 குமரி அறக்கட்டளை சார்பாக திக்கணங்கோடு அருமனை குருந்தன்கோடு  பகுதிகளில் கொரோனா நிவாரண பொருட்கள் அன்று வழங்கப்பட்டது என்பதை மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன் மேலும் உதவிய அனைத்து நல்லுள்ளங்களுக்கும் அதற்கு முயற்சி செய்த அனைவருக்கும் மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன்', 'Active'),
(56, '2022-07-31', 'Kumari Rajendran', '31/07/2022 ஆதர்ஷிகா  அவர்களுக்கு மருத்துவ உதவி ₹25000 - க்கான காசோலை வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் வாணியான் விளை பைங்குளம் பகுதியைச் சார்ந்த அகிலாவதி அவர்கள் கணவர் தர்மராஜ் வயது (42) 8300408513 அவர் விபத்தில் அடிப்பட்டு எந்த வேலைகளும் செய்ய முடியாத நிலையில் இருந்து வருகிறார். இவர்களுக்கு 2 பிள்ளைகள். இவர்களில் மூத்த பிள்ளை ஆதர்ஷிகா வயது (12) அவர்களுக்கு *மருத்துவ உதவி 31/07 /2022 அன்று மாலை :04:00 மணியளவில் குமரி அறக்கட்டளை அலுவலகம் குலசேகரத்தில் வைத்து ₹ 25000 க்கான கசோலை  வழங்கப்பட்டது  என்பதை தெரிவித்து கொள்கிறேன்* மேலும் உதவி புரிந்த அனைத்து நல்லுள்ளங்களுக்கும்  அதற்கு முயற்சி செய்தவர்களுக்கும் மனதார நன்றியை தெரிவித்து கொள்கிறேன்  *இந்த மனித பிறவியில் இப்படிப்பட்ட ஒரு சேவையை செய்ய வாய்ப்பை வழங்கிய அனைத்து நல்லுள்ளங்களுக்கும்  மனதார நன்றியை தெரிவித்து கொள்கிறோம் மேலும் இது ஒரு அரிய வாய்ப்பு பிறருக்கு தொண்டு செய்ய இந்த வாய்ப்பை தவறவிடாதீர்கள்', 'Active'),
(57, '2022-08-02', 'Kumari Rajendran', '02/08/2022 அறக்கட்டளை உறுப்பினர் ராஜன் 326 அவர்களின் மகளின்மருத்துவ உதவி ₹10000 வழங்கப்பட்டது', 'குமரி அறக்கட்டளையில் 2 ஆண்டுகளாக 326 என்ற உறுப்பினர் பதிவு எண்ணை கொண்ட சகோதரர் ஆட்டோ ஓட்டி தன் குடும்பத்தை நடத்தி,வாடகை வீட்டில் வாழ்ந்து  வருகிறார் கடந்த 6 மாதமாக தன்னுடைய இரண்டாவது மகளுக்கு உடல் நிலை சரியில்லாமால் சிகிச்சை செய்து வருகிறார் நண்பர்கள், மற்றும் உறவினர்கள் உதவியுடன் தான் இந்த சிகிச்சை செய்து வருகிறார் *மருத்துவமனை செல்ல வசதியில்லை என்று அறிந்த குமரி அறக்கட்டளையின் நிர்வாகம் அவருடைய  வீட்டிற்கு சென்று பிள்ளையை பார்த்து ஆறுதல் வழங்கி மகளின் மருத்துவ செலவிற்காக 02/08/2022 இன்று ₹10000 -க்கான காசோலை வழங்கப்பட்டது என்பதை தெரிவித்து கொள்கிறேன்* மேலும் இது ஒரு அரிய வாய்ப்பு பிறருக்கு தொண்டு செய்ய இந்த வாய்ப்பை தவறவிடாதீர்கள் மேலும் குமரி மாவட்ட மக்களுக்கு சேவை செய்ய விரும்புவர்கள் கீழே கொடுக்கப்பட்டுள்ள வங்கி கணக்கை பயன்படுத்த வேண்டுகிறேன் ??????????????\r\n*காலத்தினால் செய்த நன்றி சிறிதெனினும் ஞாலத்தின் மாணப்பெரிது*', 'Active'),
(58, '2022-08-15', 'Kumari Rajendran', 'அருமனை பகுதியை சார்ந்த வினிதா ராணி அவர்களுக்கு 15/08/2022 மருத்துவ உதவி ₹20000 வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் நல்லூர் கோணம் அருமனை பகுதியைச் சார்ந்த றெசல் ராஜ்(53) 8940267801 அவர் கூலி வேலை செய்து குடும்பத்தை நடத்தி வந்தார். மனைவி குமாரி ராஜம்(50) அவர்களுக்கு இரண்டு கால்களும் இரண்டு கைகளும் செயலிழந்து அவர்களால் எந்த வேலையும் செய்ய முடியாது. இவர்களுக்கு ஒரு மகள் வினிதா ராணி ( 24 )  .*புற்று நோயால் பாதிக்கப்பட்ட வினிதா ராணி அவர்களுக்கு மருத்துவ உதவி 15/08/2022  மாலை 4:00 மணியளவில் அவர்களின் வீட்டில் வைத்து ₹ 20000 - க்கான காசோலை குமரி அறக்கட்டளை சார்பாக வழங்கப்பட்டது* மேலும் உதவி புரிந்த அனைவருக்கும் மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன் ஜாதி மத பேதமின்றி அனைத்து மக்களுக்கும் ஒற்றுமையுடன் உதவிடுவோம்', 'Active'),
(62, '2022-08-18', 'Kumari Rajendran', '18/08/2022 அன்று ஜி வி எஸ் தனிமனித சேவை அறக்கட்டளை குமரி அறக்கட்டளையை கெளரவித்த தருணம்', '18/08/2022 ஜி வி எஸ் தனிமனித சேவை அறக்கட்டளை குமரி அறக்கட்டளையின் தன்னலமற்ற சேவையை பாராட்டி நினைவு பரிசு மற்றும் குமரி அறக்கட்டளையை கெளரவித்ததில் மிக்க மகிழ்ச்சியடைகிறோம்', 'Active'),
(63, '2019-06-14', 'Kumari Rajendran', '14/06/2019 அன்று குமரி அறக்கட்டளை ஆரம்பநிலையான குமரி இரத்த தான குழு  இரத்த தான முகாம்', '14/06/2019 அன்று குமரி இரத்த தான குழுவாக அன்று ஆரம்பித்து இன்று குமரி அறக்கட்டளை என்ற பெயரில் குமரி மக்களுக்கு சேவை செய்த வரும் இந்த அமைப்பின் வழியாக இரத்த தான முகாம் அரசு மருத்துவமனை தக்கலையில் வைத்து நடத்தப்பட்டது சுமார் 50 இரத்த தானம் செய்தனர் அனைத்து இரத்த தான நன்கொடையாளர்களுக்கும் மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன்', 'Active'),
(64, '2019-05-11', 'Kumari Rajendran', 'குமரி அறக்கட்டளையின் ஆரம்ப நிலை குமரி இரத்த தான குழுவின்  முதல் சேவை சிதறால் சித்தரலையா சேவா டிரஸ்ட', 'குமரி அறக்கட்டளையின் ஆரம்பநிலையான குமரி இரத்த தான குழுவின் முதல் கட்ட சேவை சித்தரலையா சேவா டிரஸ்ட் ஆதரவற்றோர் மையத்தில் இருக்கும் ஆதவற்றோர்களுக்கு உணவு வழங்கி தன்னலமற்ற சேவையை தொடங்கியது', 'Active'),
(65, '2022-08-31', 'Kumari Rajendran', '31/08/2022 அன்று தளிச்சதரை விளை காப்பு காடு ரவிகுமார்அவர்களுக்கு மருத்துவ உதவி ₹20000 வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் தளிசத்தரை விளை  காப்புக்காடு பகுதியை சார்ந்த  பிறேமா(45) அவர்கள் கணவர் ரவிகுமார்(50)  9543623427,6369479256.  ஆட்டோ ஓட்டி குடும்பத்தை நடத்தி வந்தார். 11 வருட காலமாக கால் சுகமில்லாமல்  மருத்துவமனை சிகிட்சை பெற்று வந்த அன்னாருக்கு மருத்துவ உதவி  31/08/2022 இன்று மாலை :04:00 மணியளவில் குமரி அறக்கட்டளை அலுவலகம் குலசேகரத்தில் வைத்து மருத்துவ உதவிக்கான காசோலை ₹ 20000 வழங்கப்பட்டது* மேலும உதவி புரிந்த அனைத்து நல்லுள்ளங்களுக்கும்  மனதார நன்றியை தெரிவித்து கொள்கிறேன்', 'Active'),
(66, '2019-08-23', 'Kumari Rajendran', '23/09/2019 ஹெல்மெட் விழிப்புணர்வு வாகன பிரச்சாரம் குலசேகரம் முதல் ஆற்றூர் மரியா காலேஜ் வரை நடைபெற்றத', 'ஹெல்மெட் விழிப்புணர்வு வாகன பிரச்சாரம் குலசேகரம் முதல் மரியா காலேஜ்ஆற்றூர்  வரை நடைபெற்றது மரியா காலேஜ் இல் வைத்து நிழ்ச்சி நடைபெற்றது', 'Active'),
(67, '2019-12-15', 'Kumari Rajendran', '15/12/2019 அன்று குமரி அறக்கட்டளை சார்பாக இரத்த தான நன்கொடையாளர்கள் மற்றும் சமூக சேவையாளர் விருது', '15/12/2019 அன்று குமரி அறக்கட்டளை சார்பாக இரத்த தான நன்கொடையாளர்கள் மற்றும் சமூக சேவையாளர்களுக்கு மார்த்தாண்டம் வர்த்தக சங்க அரங்கில் வைத்து Dr ஜெய்லானி பீபி அரசு மருத்துவர் குலசேகரம் மற்றும் ஊண்ணாமலைக்கடை முன்னாள் பேரூராட்சி தலைவர் ஜெயசீலன் Dr ஜாண்சாமூயேல் கண் மருத்துவனை களியக்காவிளை மற்றும் Adv கண்ணன் குலசேகரம் G V சுரேஷ் சுரேஷ் பேஷன் ஜுவால்லரி குலசேகரம் Dr. சில்வர்சுரேஷ் சில்வர் சுரேஷ் பேஷன் ஜுவல்லரி மார்த்தாண்டம் ஆகியோர்கள் மற்றும் குமரி அறக்கட்டளை நிர்வாகிகள் கலந்து கொண்டு இரத்த தான நன்கொடையாளர்களை வாழ்த்தி விருது வழங்கி கெளரவித்தனர்', 'Active'),
(68, '2022-09-15', 'Kumari Rajendran', '15/09/2022 அன்று கண்ணணூர் தங்க ரோஸ் அவர்களுக்கு மருத்துவ உதவி ₹15000 வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் பூந்தோப்பு கண்ணனூர் பகுதியைச் சார்ந்த தங்கறோஸ் அவர்கள் கணவர் ராஜசேகர் வயது    (48) 9842870748 கூலி வேலை செய்து குடும்பத்தை நடத்திவந்தார்.ராஜசேகர் அவர்களுக்கு 15/09/2022 அன்று மாலை :03:00 மணியளவில் குமரி அறக்கட்டளை அலுவலகம் குலசேகரத்தில் வைத்து மருத்துவ உதவித்தொகை ரூ.15000|-க்கான காசோலை வழங்கப்பட்டது என்பதை மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன்', 'Active'),
(69, '2022-09-30', 'Kumari Rajendran', '30/09/2022 மணிகண்டன் ஆசாரிப்பள்ளம் அவர்களுக்கு மருத்துவ உதவி ₹ 20,000- க்கான காசோலை வழங்கப்பட்டது', '*இயன்றதை செய்வோம்☪️?️✝️ இயலாதவர்கே*\r\n\r\n*குமரி அறக்கட்டளை*\r\n*பதிவு எண்:36/2019*\r\n *குலசேகரம்*\r\n*மத்திய மாநில அரசு அங்கீகாரம் பெற்றது*\r\n\r\nநன்கொடையாளர்களுக்கு *வரி விலக்கு உண்டு 12A 80G உள்ளது*\r\n\r\nகுமரி மாவட்டத்தில் மேலப்பெரு விளை ஆசாரிப்பள்ளம் பகுதியைச் சார்ந்த மகேஸ்வரி வயது (43) அவர்களின் கணவர் நடராஜன் 6381413012 \r\nஇவர்களின் மகன் மணிகண்டன் வயது (19) இவர் 25/08/2022 விபத்திற்குள்ளாகி சிகிட்சை பெற்று கொண்டிருக்கின்றார் *மணிகண்டன் அவர்களுக்கு  30/9/2022 மாலை 4:00 மணி அளவில் மணிகண்டன் அவர்கள் வீட்டில் வைத்து மருத்துவ உதவி தொகை  ரூ.20,000- க்கான  காசோலை குமரி அறக்கட்டளை சார்பாக வழங்கப்பட்டது  என்பதை மிக மகிழ்ச்சியுடன் தெரிவித்துக் கொள்கிறோம்', 'Active'),
(70, '2022-10-15', 'Kumari Rajendran', '15/10/2022 அன்று ஜென்சி அருமனை அவர்களுக்கு மருத்துவ உதவி ₹15000 வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் நல்லூர் கோணம் அருமனை பகுதியைச் சார்ந்த ஜென்சி வயது (50)9600497525 அவர்களுக்கு *மருத்துவ உதவி 15/10/2022  இன்று மாலை :05:00 மணியளவில்  அவர்களின் வீட்டில் வைத்து ரூ.15000|- க்கான காசோலை வழங்கப்பட்டதென்பதை மிக மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன்* இந்த குடும்பத்திற்கு உதவி செய்த அனைத்து நல்லுள்ளங்களுக்கும்  குமரி அறக்கட்டளை சார்பாக  மனமார்ந்த நன்றியை தெரிவித்துக் கொள்கிறோம்', 'Active'),
(71, '2022-10-30', 'Kumari Rajendran', '30/10/2022 அன்று ஆனந்த் வெட்டூர்னிமடம் அவர்களுக்கு ₹20000 மருத்துவ உதவி வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் 183/59 அருள் மேரி தெரு வெட்டூர்னிமடம் பகுதியைச் சார்ந்த ஷைலா வயது (40)7339391703 அவர்களின் கணவர் ஆனந்த் அவர்களுக்கு *மருத்துவ உதவி 30/10/2022 அன்று மாலை :03:00 மணியளவில்  வெட்டூர்னி மடத்தில் அவர்களின் வீட்டில் வைத்து ₹20000 -க்கான காசோலை  வழங்கப்பட்டது  என்பதை  தெரிவித்து கொள்கிறோம்* மேலும் உதவி புரிந்த அனைத்து நல்லுங்களுக்கும் அதற்கு முயற்சி செய்தவர்களுக்கும் மனதார நன்றியை தெரிவித்து கொள்கிறோம்', 'Active'),
(72, '2022-11-12', 'Kumari Rajendran', '12/11/2022 அன்று 3500 யூனிட் இரத்தத்தை குமரி அறக்கட்டளை தானமாக செய்து சாதனை படைத்துள்ளது', 'குமரி அறக்கட்டளை  12/12/2022 இன்றுடன்  அலுவலக பதிவேட்டின்படி *3500 யூனிட் இரத்தத்தை தானமாக செய்து சாதனை படைத்துள்ளது என்பதை மகிழ்ச்சியுடன் தெரிவித்து கொள்கிறேன்* மேலும் தன்னலமற்ற இந்த சேவையை செய்து கொண்டிருக்கின்ற குமரி மாவட்ட இரத்த தான நன்கொடையாளர்களுக்கு குமரி அறக்கட்டளை சார்பாகவும் என் சார்பாகவும் நன்றியை தெரிவித்து கொள்கிறேன் ????????????????????????????????????????????', 'Active'),
(73, '2022-11-15', 'Kumari Rajendran', '15/11/2022 மாங்கோடு பகுதியை சார்ந்த கின்னம்மா அவர்களுக்கு உதவித்தொகை ₹15000 வழங்கப்பட்டது', 'குமரி மாவட்டத்தில் வெள்ளச்சிப்பாறை மாங்கோடு பகுதியைச் சார்ந்த தோமஸ்வர்கீஸ் அவர்கள் வயது (65)மனைவி கின்னம்மா  வயது (63) 8344923507 அவர்களுக்கு *மருத்துவ உதவி  15/11/2022  மாலை :04:00 மணியளவில் உதவித்தொகை ₹15000-க்கான காசோலை வழங்கப்பட்டது என்பதை தெரிவித்து கொள்கிறேன்* இக்குடும்பத்திற்கு உதவி செய்த அனைத்து நல்லுள்ளங்களுக்கும் மனமார்ந்த நன்றியை தெரிவித்து கொள்கிறேன்', 'Active');
